{"nbformat":4,"nbformat_minor":0,"metadata":{"colab":{"provenance":[],"authorship_tag":"ABX9TyP/gblICeeMUDDhjoUKgZjK"},"kernelspec":{"name":"python3","display_name":"Python 3"},"language_info":{"name":"python"}},"cells":[{"cell_type":"code","source":["import numpy as np\n","import matplotlib.pyplot as plt\n","from sklearn.cluster import KMeans\n","from sklearn import metrics\n","\n","# Loading input data\n","X = np.loadtxt('data_clustering.txt', delimiter=',')\n","\n","# Define the number of clusters\n","num_clusters = 5\n","\n","# Apply KMeans clustering\n","kmeans = KMeans(n_clusters=num_clusters, random_state=42)\n","kmeans.fit(X)\n","y_kmeans = kmeans.predict(X)\n","\n","# Include input data in the graph\n","plt.figure()\n","plt.scatter(X[:, 0], X[:, 1], marker='o', facecolors='none', edgecolors='black', s=80)\n","\n","# Plot cluster centers\n","plt.scatter(kmeans.cluster_centers_[:, 0], kmeans.cluster_centers_[:, 1], marker='x', color='red', s=200, label='Cluster Centers')\n","\n","# Set plot limits and title\n","x_min, x_max = X[:, 0].min()-1, X[:, 0].max() + 1\n","y_min, y_max = X[:, 1].min()-1, X[:, 1].max() + 1\n","plt.title('Input data')\n","plt.xlim(x_min, x_max)\n","plt.ylim(y_min, y_max)\n","\n","# Add x and y labels, and legend\n","plt.xlabel('Feature 1')\n","plt.ylabel('Feature 2')\n","plt.legend()\n","\n","# Show the plot\n","plt.show()\n","\n","# Creation of the KMeans object\n","kmeans = KMeans(init='k-means++', n_clusters=num_clusters, n_init=10)\n","\n","# Learning the KMeans clustering model\n","kmeans.fit(X)\n","\n","# Defining the grid step\n","step_size = 0.01\n","\n","# Display grid points\n","x_min, x_max = X[:, 0].min()-1, X[:, 0].max()+1\n","y_min, y_max = X[:, 1].min()-1, X[:, 1].max()+1\n","x_vals, y_vals = np.meshgrid(np.arange(x_min, x_max, step_size),\n","                             np.arange(y_min, y_max, step_size))\n","\n","# Prediction of output labels for all grid points\n","grid_points = np.c_[x_vals.ravel(), y_vals.ravel()]\n","output = kmeans.predict(grid_points)\n","\n","# Graphical display of areas and their color selection\n","output = output.reshape(x_vals.shape)\n","plt.figure()\n","plt.clf()\n","plt.imshow(output, interpolation='nearest', extent=(x_vals.min(), x_vals.max(), y_vals.min(), y_vals.max()), cmap=plt.cm.Paired, aspect='auto', origin='lower')\n","\n","# Display entry points\n","plt.scatter(X[:, 0], X[:, 1], marker='o', facecolors='none', edgecolors='black', s=80)\n","\n","# Display of cluster centers\n","cluster_centers = kmeans.cluster_centers_\n","plt.scatter(cluster_centers[:, 0], cluster_centers[:, 1], marker='o', s=210, linewidths=4, color='black', zorder=12, facecolors='black')\n","\n","# Set plot limits and title for cluster boundaries\n","plt.title('Boundaries of clusters')\n","plt.xlim(x_min, x_max)\n","plt.ylim(y_min, y_max)\n","plt.xticks(())\n","plt.yticks(())\n","plt.show()\n"],"metadata":{"colab":{"base_uri":"https://localhost:8080/","height":883},"id":"DZE_hHCX7st3","executionInfo":{"status":"ok","timestamp":1734948492642,"user_tz":-120,"elapsed":1680,"user":{"displayName":"Ярослав Білотіл","userId":"06797585363548962278"}},"outputId":"8982774c-acf4-4086-c2bd-4eb195ddab7b"},"execution_count":6,"outputs":[{"output_type":"display_data","data":{"text/plain":["<Figure size 640x480 with 1 Axes>"],"image/png":"\n"},"metadata":{}},{"output_type":"display_data","data":{"text/plain":["<Figure size 640x480 with 1 Axes>"],"image/png":"\n"},"metadata":{}}]}]}